(5, '{\"ops\":[{\"insert\":\"نسعى للوصول إلى ترصين برامج التعليم الجامعي الأهلي في الكلية ضمن بيئة أخلاقية علمية وإبداعية من خلال تطبيق معايير الإعتماد الأكاديمي لنيل رضا الطالب والجهات المستفيدة في بناء المعرفة والمهارة والقدرات التي يجب تحقيقها في مخرجاتنا التعليمية.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"التأكيد على تكامل المعرفه النظريه والتطبيقيه.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"الارتقاء للحصول على الاعتماد الاكاديمي من خلال تطبيق الرصانه في اختيار البرامج التعليميه.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\"},\"insert\":\"\\n\"},{\"insert\":\"التحول الى كلية رصينه خاصه تتماشى مع ضوابط وزارة التعليم العالي والبحث العلمي في برامج الاعتماد الاكاديمي.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"نيل شهادة المطاقه الدوليه للايزو 2018/21001.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"النفتاح على المحيط المحلي الاقليمي والدولي من خلال اتفاقيات التبادل الثقافي والعلمي.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"الحصول على اعتماد وطني للبرامج الاكاديميه في الكليه ومن خلال تطبيق معايير الاعتمام المؤسسي .\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"الوصول الى مخرجات تعليميه عالية الجوده مؤهله للدخول الى سوق العمل .\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"دعم البحث العلمي بما يحقق مستوى عالي للبحث والتطويريمكننا المنافسه من خلاله وباحثين قادرين على احداث تغيرات علميه ومعرفيه في المجتمع.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"خلق نواة دعم للمجتمع وسوق العمل تتكون من خلالها كلية النسور الجامعة رائده في تهيئة الخريجين للعمل الوظيفي داخل وخارج البلد.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\",\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\"},\"insert\":\"\\n\\n\"},{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"vision2\\n\"}]}', '{\"ops\":[{\"insert\":\"message2\\n\"}]}', '{\"ops\":[{\"insert\":\"goals\\n\"}]}', 6, '2021-08-22 11:06:18', '2021-09-13 09:06:47', 1),
(6, '{\"ops\":[{\"insert\":\"نراتلبيلاتزنمكنتادل\\n\"}]}', '{\"ops\":[{\"insert\":\"تهاعلغبفيطبذلدازترنو\\n\"}]}', '{\"ops\":[{\"insert\":\"تالغعبفذل\\n\"}]}', '{\"ops\":[{\"insert\":\"نحاعلغبفيقسطبذلدازتنرمو\\n\"}]}', '{\"ops\":[{\"insert\":\"ونرتالبطيبذلدازتنر\\n\"}]}', '{\"ops\":[{\"insert\":\"البذطيبذلدازترنو\\n\"}]}', 17, '2021-08-24 18:13:06', '2021-09-13 09:06:47', 1),
(7, '{\"ops\":[{\"insert\":\"يعتبر قسم تقنيات المختبرات الطبية احد الأقسام المهمة ضمن المجموعة الطبية لما له من دور فعال في توفير الكوادر العاملة في مجال التحليلات المرضية في مختبرات وزارة الصحة و القطاع الخاص, اضافة لما للقسم من دور في دعم الجانب العلمي و البحثي من خلال استثمار دور التدريسيين في رفد البحوث العلمية .\\n\"}]}', '{\"ops\":[{\"insert\":\" تم انشاء قسم تقنيات المختبرات الطبية وفق منهج التطور العلمي واعتمادها البنية الاساس التي يستند عليها القسم للتطور العلمي من دور فعلا في تشخيص و علاج الكثير من الحالات المرضية. كذلك يعمل القسم على فتح جميع الافاق المعرفية والمنهجية لغرض التوسع وبناء حلقات الأرتباط مع المؤسسات والأقسام المناظرة لغرض استكمال المهمة التشخيصية التي تساعد المستفيد للحصول على الدقة و السرعة في تشخيص الحالات المرضية. اضافة الى تبني المنهج البحثي للعاملين في القطاعات ذات العلاقة لغرض الوصول الى منهج عمل وافكار تخدم المجتمع وبشكل عام.\\n\"}]}', '{\"ops\":[{\"insert\":\"الإلمام بالمعلومات النظرية المتعلقة بالأمراض التي يتم تشخيصها مختبريا . \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"فهم وممارسة تقنيات التشخيص المختبري في مجال الأمراض والطفيليات والتقنيات المختبرية المتقدمة وأمراض الدم ونقل الدم والمناعة السريرية وكذلك الأنسجة المرضية والفايروسات والوراثة. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"الإلمام بالمعلومات العامة المتعلقة بالفسلجة ومبادئ الأحياء الطبي والتشريح والأنسجة كونها معلومات أساسية طبية تساعدهم في فهم طبيعة الجسم في حالتي الصحة والمرض .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"معرفة أخلاقيات المهنة وكيفية التعامل مع المرضى وخصوصياتهم وكذلك معرفة وسائل التواصل معهم ومع أقربائهم بطريقة علمية وإنسانية وكذلك معرفة مبادئ حقوق الإنسان.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"معرفة أساليب إدارة المختبرات والتقنيات المتعلقة بحفظ البيانات وإعداد الإحصائيات الضرورية.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"The Department of Medical Laboratory Technologies is one of the important departments within the medical group because of its effective role in providing cadres working in the field of pathological analyzes in the laboratories of the Ministry of Health and the private sector, in addition to the department’s role in supporting the scientific and research side by investing the role of the teaching staff in increasing Scientific research.\\n\"}]}', '{\"ops\":[{\"insert\":\"The Department of Medical Laboratory Technologies was established in accordance with the scientific development approach and its adoption as the basis on which the department is based. Scientific development has actually played a role in diagnosing and treating many pathological conditions. The department also works to open all knowledge and methodological horizons for the purpose of expanding and building links with the corresponding institutions and departments for the purpose of completing the diagnostic task that helps the beneficiary to obtain accuracy and speed in diagnosing diseased cases. In addition to adopting the research approach for workers in the relevant sectors for the purpose of arriving at a work approach and ideas that serve the community and in general.\\n\"}]}', '{\"ops\":[{\"insert\":\"Familiarity with theoretical information related to diseases diagnosed in the laboratory.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Understand and practice laboratory diagnostic techniques in the field of diseases, parasitology, advanced laboratory techniques, hematology, blood transfusion, clinical immunology as well as histology, viruses and genetics.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Familiarity with general information related to physiology, principles of medical biology, anatomy and histology, being basic medical information that helps them understand the nature of the body in both health and disease.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Knowing the ethics of the profession and how to deal with patients and their privacy, as well as knowing the means of communication with them and their relatives in a scientific and humane way, as well as knowledge of human rights principles.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Knowledge of laboratories management methods and techniques related to data preservation and preparation of necessary statistics.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 17, '2021-08-25 05:51:13', '2021-09-13 09:06:47', 0),
(9, '{\"ops\":[{\"insert\":\"تتمثل الرؤية في قسم القانون في مواكبة التطورات العلمية الحاصلة في حقل القانون والتخصصات الدقيقة فيه والعمل على تطوير وتحسين الأداء وفقاً لمعايير الجودة وتقييم الأداء في الجامعات العراقية والعالمية وضمان تمتع الاساتذة والتدريسيين بالكفاءة العلمية والعملية.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"The vision of the Law Department is to keep pace with the scientific developments in the field of law and its delicate disciplines, to develop and improve performance in accordance with quality standards and to evaluate performance in Iraqi and international universities, and to ensure that professors and teachers enjoy scientific and practical competence.\\n\"}]}', '{\"ops\":[{\"insert\":\"The development of scientific reality in the field of law, theoretically and practically.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Raising the level of competence of law students to qualify them to practice legal specialization in the field of employment, law and other fields.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Adopting and designing the course system according to the standards in the specialization in the corresponding departments.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Adopting and designing the course system according to the standards in the specialization in the corresponding departments.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"Seeking that Al-Qassam occupies a distinguished position, not only at the level of the departments of Al-Nisour College, but also at the level of other similar departments in the corresponding universities and educational institutions.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"The department aims to prepare a legal generation that understands the concept of law and the various legal legislations for the purpose of contributing to the service and development of society.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Raising the department’s reputation and the students’ reputation by presenting a developmental and educational message in various legal sciences.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Consolidating the concept of the rules of professional conduct for law students represented in honesty, honesty and ethics in the profession and job and its secrets.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Training law department students by developing their scientific and practical skills and developing scientific research methods, as well as by setting up virtual courts and practicing legal work.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 12, '2021-08-25 06:44:02', '2021-09-13 09:06:47', 1),
(10, '{\"ops\":[{\"insert\":\"تتمثل الرؤية في قسم القانون في مواكبة التطورات العلمية الحاصلة في حقل القانون والتخصصات الدقيقة فيه والعمل على تطوير وتحسين الأداء وفقاً لمعايير الجودة وتقييم الأداء في الجامعات العراقية والعالمية وضمان تمتع الاساتذة والتدريسيين بالكفاءة العلمية والعملية.\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\"},\"insert\":\"\\n\\n\"},{\"insert\":\"يمكنكم الاطلاع على الوصف الاكاديمي الخاص بقسم القانون  \"},{\"attributes\":{\"background\":\"#ffffff\",\"link\":\"https://e-learn.nuc.edu.iq/files/law.pdf\"},\"insert\":\"https://e-learn.nuc.edu.iq/files/law.pdf\"},{\"attributes\":{\"align\":\"right\",\"direction\":\"rtl\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"تطوير الواقع العلمي في حقل القانون نظريا وعملياً.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"رفع مستوى الكفاءة لدى طلبة القانون بما يؤهلهم لممارسة التخصص القانوني في مجال الوظيفة والمحاماة وغيرها من المجالات الأخرى. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"اعتماد وتصميم نظام المقررات وفق المعايير في الاختصاص في الأقسام المناظرة. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تفعيل وتوضيب الإجراءات العلمية والعملية وبرامج التدريب ورفع مهارات الجودة في مخرجات العمليات التعليمية. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"السعي الى ان يحتل القسام مكانة متميزة ليس على مستوى أقسام كلية النسور فحسب وإنما على مستوى الاقسام الاخرى المماثلة في الجامعات والمؤسسات التعليمية المناظرة.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"يهدف القسم الى اعداد جيل قانوني مستوعب لمفهوم القانون والتشريعات القانونية المختلفة لغرض الإسهام في خدمة المجتمع وتطوره. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"رفع سمعة القسم وسمعة الطلبة من خلال تقديم رسالة تنموية وتعليمية في مختلف العلوم القانونية. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"ترسيخ مفهوم قواعد السلوك المهني لطلبة القانون المتمثلة في الأمانة والصدق والأخلاق في المهنة والوظيفة وأسرارها.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تدريب طلبة قسم القانون من خلال تطوير مهاراتهم العلمية والعملية وتطوير أساليب البحث العلمي وكذلك من خلال اقامة المحاكم الافتراضية وممارسة العمل القانوني.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"The vision of the Law Department is to keep pace with the scientific developments in the field of law and its delicate disciplines, to develop and improve performance in accordance with quality standards and to evaluate performance in Iraqi and international universities, and to ensure that professors and teachers enjoy scientific and practical competence.\\n\\nYou can view the academic description of the Law Department \"},{\"attributes\":{\"background\":\"#ffffff\",\"link\":\"https://e-learn.nuc.edu.iq/files/law.pdf\"},\"insert\":\"https://e-learn.nuc.edu.iq/files/law.pdf\"},{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"The development of scientific reality in the field of law, theoretically and practically.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Raising the level of competence of law students to qualify them to practice legal specialization in the field of employment, law and other fields.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Adopting and designing the course system according to the standards in the specialization in the corresponding departments.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Adopting and designing the course system according to the standards in the specialization in the corresponding departments.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"Seeking that Al-Qassam occupies a distinguished position, not only at the level of the departments of Al-Nisour College, but also at the level of other similar departments in the corresponding universities and educational institutions.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"The department aims to prepare a legal generation that understands the concept of law and the various legal legislations for the purpose of contributing to the service and development of society.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Raising the department’s reputation and the students’ reputation by presenting a developmental and educational message in various legal sciences.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Consolidating the concept of the rules of professional conduct for law students represented in honesty, honesty and ethics in the profession and job and its secrets.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Training law department students by developing their scientific and practical skills and developing scientific research methods, as well as by setting up virtual courts and practicing legal work.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 12, '2021-08-25 06:46:19', '2021-09-27 10:06:51', 0),
(11, '{\"ops\":[{\"insert\":\"نسعى في تكوين ونشر ثقافة المعرفة الإدارية لتأهيل الطلبة ليكونوا إداريين ناجحين وذوي مهارة وكفاءة عالية على وفق مناهج معتمدة عالميا متوافقة مع المستجدات العلمية في حقل الاختصاص .\\n\\nيمكنكم الاطلاع على الوصف الاكاديمي الخاص بقسم ادارة الاعمال \"},{\"attributes\":{\"link\":\"https://e-learn.nuc.edu.iq/files/bs.pdf\"},\"insert\":\"https://e-learn.nuc.edu.iq/files/bs.pdf\"},{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"في ضوء متطلبات اكمال المناهج الدراسية لطلبتنا في مجال إدارة الأعمال من أجل الحصول على درجة البكالوريوس، يسعى القسم إلى تغطية هذه المتطلبات معززة بالمفردات الدراسية واعتماد كل ما يلزم لإكمالها مع إلحاق ذلك بإلزام الطلبة بأعداد البحوث والتقارير المتخصصة وعلى وفق متطلبات جودة التعليم. \\n\"}]}', '{\"ops\":[{\"insert\":\"رفع مهارة وكفاءة الطلبة المقبولين بما يؤدي الى النهوض بالواقع الاقتصادي والاجتماعي والإداري والتخطيطي. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"إعداد خريجين ملمين بالخبرات الإدارية والتقنية متمكن من استخدام الوسائل الحديثة في الحياة العملية. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تقديم كفاءات استشارية في مجال الإدارة العامة وإدارة الأعمال. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تقديم مناهج إدارية وعملية في البحث والتطوير الإداري.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"We seek to form and disseminate a culture of administrative knowledge to qualify students to be successful, skilled, and highly qualified administrators in accordance with internationally approved curricula that are compatible with scientific developments in the field of specialization.\\n\\nYou can view the academic description of the Law Department \"},{\"attributes\":{\"background\":\"#ffffff\",\"link\":\"https://e-learn.nuc.edu.iq/files/bs.pdf\"},\"insert\":\"https://e-learn.nuc.edu.iq/files/bs.pdf\"},{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"In light of the requirements to complete the curricula for our students in the field of business administration in order to obtain a bachelor’s degree, the department seeks to cover these requirements, reinforced with academic vocabulary and adopt everything necessary to complete them, with the addition of obligating students to prepare research and specialized reports in accordance with the requirements of the quality of education.\\n\"}]}', '{\"ops\":[{\"insert\":\"Raising the skill and efficiency of accepted students in a way that leads to the advancement of the economic, social, administrative and planning reality.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Preparing graduates who are familiar with administrative and technical experiences, able to use modern means in practical life.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Providing advisory competencies in the field of public administration and business administration.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Providing administrative and practical approaches to administrative research and development.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 13, '2021-08-25 06:50:26', '2021-09-27 10:00:09', 0),
(12, '{\"ops\":[{\"insert\":\"إعداد خريج متميز في مجال الادارة الرياضية لديه المعلومات والخبرات العلمية والإدارية الكافية التي يوفرها له برنامج القسم لتمكنه من القيام بكافة الأعمال في مختلف الهيئات الرياضية والمساعدة في إجراء البحوث العلمية وتقديم المشورة العلمية والبرامج المتنوعة لقطاعات المجتمع ذات الصلة بالرياضة.\\n\"}]}', '{\"ops\":[{\"insert\":\"إعداد الملاكات العلمية النوعية المؤهلة والمتخصصة في مجال التربية البدنية وعلوم الرياضة ومن خلال تقديم البرامج التعليمية والبحثية والأكاديمية المتميزة والاستفادة من الموارد المتاحة للمساهمة في تربية الفرد والمجتمع فضلاً عن إعداد الباحثين في مجال العلوم الرياضية للارتقاء في الحركة الرياضية العراقية وعلى مختلف المستويات.\\n\"}]}', '{\"ops\":[{\"insert\":\"إعداد كوادر وطنية متخصصة ومؤهلة علمياً وتربويا في مجال تدريس التربية البدنية وكذلك للعمل في مراحل التعليم العام والخاص وقطاع الرياضة و الشباب واللجنة الأولمبية والاتحادات الرياضية والقطاعات العسكرية والاهلية وبالتالي الإسهام في سد الفراغ الكبير المتمثل في الاحتياج ذا التخصص .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"إجراء البحوث العلمية والدراسات الميدانية في مجال التخصص. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تنظيم المؤتمرات والندوات وورش العمل وإجراء المشروعات في مجال التخصص. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"منح الشهادات من خلال الدورات التدريبية لتأهيل العاملين من المدرسين والمتدربين في مجالات التربية البدنية المختلفة التخصصية لتأهيل العاملين في مجالات التربية البدنية المختلفة. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"رفع المستوى المهني لدى العاملين في مجال التربية البدنية وتعريفهم بالاتجاهات العلمية والتربوية المعاصرة.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"Preparing a distinguished graduate in the field of sports management who has sufficient scientific and administrative information and expertise provided by the department’s program to enable him to carry out all work in various sports bodies and help in conducting scientific research and providing scientific advice and various programs for sectors of society related to sports.\\n\"}]}', '{\"ops\":[{\"insert\":\"Preparing qualified and specialized scientific cadres in the field of physical education and sports sciences, by providing distinguished educational, research and academic programs and benefiting from the available resources to contribute to the education of the individual and society, as well as preparing researchers in the field of sports sciences to advance the Iraqi sports movement at various levels.\\n\"}]}', '{\"ops\":[{\"insert\":\"Preparing specialized and qualified national cadres scientifically and educationally in the field of teaching physical education, as well as to work in the stages of public and private education, the sports sector, youth, the Olympic Committee, sports federations, and the military and civil sectors, thus contributing to filling the great void represented in the need for this specialty.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Conducting scientific research and field studies in the field of specialization.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Organizing conferences, seminars and workshops and conducting projects in the field of specialization.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Granting certificates through training courses to rehabilitate teachers and trainees in the various specialized fields of physical education to qualify workers in the various fields of physical education.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Raising the professional level of workers in the field of physical education and introducing them to contemporary scientific and educational trends.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 10, '2021-08-25 06:55:29', '2021-09-13 09:06:47', 0),
(13, '{\"ops\":[{\"insert\":\"یھدف ھذا القسم لتعزیز القـدرات اللغویة والادبـیة للطلبـة، إضافة إلى تھیئتھم، أساسـاً ، لیكونوا مدرسین ومترجمین وعاملین في قطاعات العمل المختلفة . فالطالب في القسم یدرس مواداً لغویة وأدبیة متنوعة یتم التركیز فیھا على اللغة والصوت والمسرحیة والترجمة والمحـادثة بأسـتخدام وسائل عصریة منھا أحدث المختبـرات الذي یسـاعد الطلبـة على دقـة النطق وذلاقـة اللسـان.ھذا التنوع في المواد الدراسـیة یسـھم إسـھاماً فعالاً في إعداد الطلبــة لســوق العمل في القــطاع العام والخاص .\\nمدة الدراسة في القسم أربع سنوات یمنح في نھایتھا الخریجون بكالوریوس لغة إنكلیزیة.\\n\\nيمكنكم الاطلاع على الوصف الاكاديمي الخاص بقسم ادارة الاعمال \"},{\"attributes\":{\"background\":\"#ffffff\",\"link\":\"https://e-learn.nuc.edu.iq/files/english.pdf\"},\"insert\":\"https://e-learn.nuc.edu.iq/files/english.pdf\"},{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"توسيع قاعدة المفردات الدراسية ذات الاختصاص الدقيق .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تطوير الهيكل الاداري وفق متطلبات البرنامج الدراسي باختصاصات تدريسية و بالقاب علمية متقدمة .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"الاستعانة بالكليات المناظرة وفق برامج مشتركة من خلال الية المقارنة (Benchmarking).\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"توظيف القدرات الادارية و التدريسية وفق معايير المؤسسية المعتمدة في البلد .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"الحصول على مخرجات تعليمية ذات مهارات و قدرات علمية وفق المتطلبات.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تطوير و تحسين الخطط التربوية والتعليمية لتحقيق جودة المخرجات وفق متطلبات الجهة المستفيدة .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"توسيع قاعدة ادارة المعرفة في برنامج المقررات الدراسية .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"مراجعة توصيف الكوادر التدريسية المطلوبة في برنامج التعليم و التعليم في المؤسسة التعليمية بما يؤمن جودة الاداء و المخرجات .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تعزيز قدرات التدريسيين من خلال اشراكهم بدورات تطويرية في الجامعات العالمية المتقدمة .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تحقيق لقاءات علمية وعقد مؤتمرات و ندوات تصب في برامج العمليات التعليمية مع المؤسسات التعليمية و المناظرة و المستخدمة في هذا المجال .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تحقيق النضج العلمي من خلال الادلة الموضوعية لقياس جودة الاهداف للعمليات التعليمية .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"الارتقاء بمستوى الاداء لبرامج العمليات وفق محاور الاعتماد المؤسسي من حيث النتائج و المخرجات .\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"This section aims to enhance the linguistic and literary abilities of students, in addition to preparing them, basically, to be teachers, translators and workers in various sectors of work. The student in the department studies a variety of linguistic and literary subjects that focus on language, sound, drama, translation and conversation using modern methods, including the latest laboratories, which help students with accuracy of pronunciation and eloquence.\\nThe duration of study in the department is four years, at the end of which graduates are awarded a BA in English.\\n\\nYou can view the academic description of the Law Department \"},{\"attributes\":{\"background\":\"#ffffff\",\"link\":\"https://e-learn.nuc.edu.iq/files/english.pdf\"},\"insert\":\"https://e-learn.nuc.edu.iq/files/english.pdf\"},{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"Expand the vocabulary base of specific specialization.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Developing the administrative structure in accordance with the requirements of academic programs with teaching specializations and advanced scientific titles.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Using the corresponding faculties according to joint programs through the comparison mechanism (Benchmarking).\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Employing administrative and teaching capabilities in accordance with the institutional standards adopted in the country.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"Obtaining educational outcomes with scientific skills and abilities according to the requirements.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Develop and improve educational and educational plans to achieve the quality of outputs according to the requirements of the beneficiary.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Expand the knowledge management base in the course program.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Reviewing the description of the teaching staff required in the teaching and learning program in the educational institution to ensure the quality of performance and outputs.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Strengthening the capabilities of teachers by engaging them in development courses in advanced international universities.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Achieving scientific meetings and holding conferences and symposia that fall into the educational operations programs with educational institutions and the debate and use in this field.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Achieving scientific maturity through objective evidence to measure the quality of objectives for educational processes.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Raising the level of performance of operations programs according to the axes of institutional accreditation in terms of results and outputs.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 11, '2021-08-25 07:02:35', '2021-09-28 10:09:13', 0),
(14, '{\"ops\":[{\"insert\":\"ثهبتثهخبلاثلاذذ\\n\"}]}', '{\"ops\":[{\"insert\":\"ثعهلاثعثباعهثلبا\\n\"}]}', '{\"ops\":[{\"insert\":\"ثصباثعهباثخبا\\n\"}]}', '{\"ops\":[{\"insert\":\"idhfiehgoiehg\\n\"}]}', '{\"ops\":[{\"insert\":\"oefheogheohg\\n\"}]}', '{\"ops\":[{\"insert\":\"sfheuifgeiugfeig\\n\"}]}', 19, '2021-08-25 07:16:34', '2021-09-13 09:06:47', 1),
(15, '{\"ops\":[{\"insert\":\" ثلثحخ\\t\\n\"}]}', '{\"ops\":[{\"insert\":\"لثخلﻻث\\n\"}]}', '{\"ops\":[{\"insert\":\"لثهلﻻ\\n\"}]}', '{\"ops\":[{\"insert\":\"fheofh fepogejge\\n\"}]}', '{\"ops\":[{\"insert\":\"jfiejgfe\\n\"}]}', '{\"ops\":[{\"insert\":\"fefghef\\n\"}]}', 20, '2021-08-25 07:58:38', '2021-09-13 09:06:47', 1),
(16, '{\"ops\":[{\"insert\":\"قسمٌ متميزٌ في تعليم التقنية الإشعاعية والتصوير الطبي، وداعمٌ لمسيرة التنمية والبحث والتطوير في العراق، مسهمٌ في بناء المجتمع الصحي. \\n\"}]}', '{\"ops\":[{\"insert\":\"تأهيل كفاءات محلية قادرة على تلبية احتياجات سوق العمل في مختلف مجالات تقنيات الأشعة والتصوير الطبي مع التركيز على أخلاقيات المهنة وتحقيق شروط السلامة والجودة النوعية، وتقديم خدمات بحثية واستشارية للمجتمع المحلي. \\n\"}]}', '{\"ops\":[{\"insert\":\" يسعى قسم تقنيات الأشعة والسونار بكلية النسور إلى تحقيق عدد من الأهداف لتنمية وتطوير مجال خدمات الأشعة، وذلك من خلال:-\\nتخريج أخصائيين مؤهلين بالمعرفة والمهارات التي تمكّنهم من التعامل بكفاءة مع أجهزة الأشعة والتصوير الطبي وعمل الفحوصات الإشعاعية بمختلف أنواعها.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تدريب الطلاب على كيفية التعامل مع مختلف الحالات المرضية داخل قسم الأشعة وطرق العناية بها، وتبرير التعرض الإشعاعي لها. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"إعداد الطلاب بالأسس الأخلاقية المهنية والإدارية والجودة التصويرية بقسم الأشعة. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"توعية الطلاب وتعريفهم بمخاطر التعرض للإشعاع وكيفية حماية العاملين والمرضى من هذه المخاطر. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تنمية القدرات التعليمية والبحثية ومهارات الإبداع لدى الطلاب.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"توفير البيئة المناسبة والإمكانيات اللازمة لتمكين أعضاء هيئة التدريس من زيادة قدراتهم وتطوير مهاراتهم الأكاديمية لضمان جودة مخرجات التعليم.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"A distinguished department in the education of radiological technology and medical imaging, and supports the process of development, research and development in Iraq, contributing to building a healthy society.\\n\"}]}', '{\"ops\":[{\"insert\":\"Qualifying local competencies capable of meeting the needs of the labor market in various fields of radiology and medical imaging techniques with a focus on professional ethics, achieving safety and quality conditions, and providing research and advisory services to the local community.\\n\"}]}', '{\"ops\":[{\"insert\":\"The Department of Radiology and Ultrasound Technologies at Al-Nisour College seeks to achieve a number of goals to develop and develop the field of radiology services, through:\\nGraduating qualified specialists with the knowledge and skills that enable them to efficiently deal with radiology and medical imaging devices and perform radiological examinations of all kinds.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Training students on how to deal with various pathological conditions within the radiology department and ways to care for them, and justify radiation exposure to them.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Preparing students with professional and administrative ethics and imaging quality in the Department of Radiology.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Educating students and familiarizing them with the risks of exposure to radiation and how to protect workers and patients from these risks.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Developing educational and research capabilities and creativity skills of students.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Providing the appropriate environment and the necessary capabilities to enable faculty members to increase their capabilities and develop their academic skills to ensure the quality of educational outcomes.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 15, '2021-08-30 13:17:13', '2021-09-13 09:06:47', 0),
(17, '{\"ops\":[{\"insert\":\"قسم رائد في تعليم تقنيات التخدير وداعم مسيرة التنمية والبحث والتطوير في العراق، يساهم في بناء المجتمع الصحي.\\n\"}]}', '{\"ops\":[{\"insert\":\"تأهيل كفاءات محلية قادرة على تلبية احتياجات سوق العمل في مختلف مجالات تقنيات التخدير.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"التركيز على أخلاقيات المهنة وتحقيق شروط السلامة والجودة النوعية.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تقديم خدمات بحثية واستشارية للمجتمع المحلي تتضمن هذه الرسالة العناصر الأساسية في تحسين رعاية المرضى في العراق بحيث تشمل التعليم والأبحاث العلمية والتعليم المستمر وخدمة المجتمع.  \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تأهيل كفاءات مهنية في تقنيات التخدير والإسهام بفعالية في البحث العلمي وخدمة المجتمع من خلال بيئة محفزة لاكتساب ونشر وإنتاج المعرفة في تقنيات التخدير توظيف الأمثل للتقنية وبناء الشراكات المحلية والعالمية. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"يهدف القسم الى تنمية وتطوير مجال تقنيات التخدير وذلك من خلال الأهداف التالية:-\\nتخريج أخصائيين مؤهلين بالمعرفة والمهارات التي تمكنهم من التعامل بكفاءة مع اجهزة التخدير بمختلف انواعها. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تدريب الطلبة على كيفية التعامل مع مختلف الحالات المرضية داخل قسم تقنيات التخدير وطرق العناية بها.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"إعداد الطلبة بالأسس الأخلاقية المهنية والإدارية والجودة بتقنيات التخدير. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تنمية القدرات التعليمية والبحثية ومهارات الإبداع لدى الطلاب. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"توفير البيئة المناسبة والامكانيات اللازمة لتمكين أعضاء هيئة التدريس من زيادة قدراتهم وتطوير مهاراتهم الأكاديمية لضمان جودة التعليم. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تشجيع أعضاء هيئة التدريس على المساهمة الفاعلة في البحوث العلمية والدراسات الأكاديمية. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"الاستفادة من الخبرات الأكاديمية والمهنية لأعضاء هيئة التدريس في خدمة الجامعة والمساهمة في حل بعض المشكلات التي تواجه المجتمع في مجال تخصصهم.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"A pioneering department in teaching anesthesia techniques and supporting the process of development, research and development in Iraq, contributing to building a healthy society.\\n\"}]}', '{\"ops\":[{\"insert\":\"Qualifying local competencies capable of meeting the needs of the labor market in the various fields of anesthesia techniques.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Focusing on professional ethics and achieving safety and quality conditions.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Providing research and advisory services to the local community. This mission includes the basic elements in improving patient care in Iraq, including education, scientific research, continuing education, and community service.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Qualifying professional competencies in anesthesia techniques and effectively contributing to scientific research and community service through a stimulating environment for acquiring, disseminating and producing knowledge in anesthesia techniques, optimizing the use of technology and building local and global partnerships.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"The department aims to develop and develop the field of anesthesia techniques through the following objectives:-\\nGraduating qualified specialists with the knowledge and skills that enable them to deal efficiently with anesthesia devices of various kinds.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Training students on how to deal with various pathological conditions within the Department of Anesthesia Techniques and Methods of Care for them.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Preparing students with professional and administrative ethics and quality in anesthesia techniques.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Developing educational and research capabilities and creativity skills of students.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Providing the appropriate environment and the necessary capabilities to enable faculty members to increase their capabilities and develop their academic skills to ensure the quality of education.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Encouraging faculty members to actively contribute to scientific research and academic studies.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Benefiting from the academic and professional experiences of faculty members in serving the university and contributing to solving some problems facing society in their field of specialization.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 16, '2021-08-30 13:27:34', '2021-09-13 09:06:47', 0),
(18, '{\"ops\":[{\"insert\":\"السعي لتأمين وتحقيق برامج تعليمية وتربوية وإنسانية من أجل رفع مهارات وبناء قدرات المخرجات التعليمية في التعليم والتدريب الصيدلاني والبحث العلمي لتطوير الخدمات الصيدلانية المقدمة للجهات المستفيدة.\\n\"}]}', '{\"ops\":[{\"insert\":\"إعداد صيادلة إكلينيكيين كفوءين حاصلين على شهادة متخصصة بعلوم الصيدلة وفق المعايير العالمية ليكونوا قادرين على تطبيق ممارسات الصيدلة السريرية وتوفير الخدمة العلاجية للمرضى من خلال فتح نوافذ تعليمية وتربوية مع مؤسسات تعليمية مناظرة في هذا المجال للاستفادة من الخبرات المتراكمة لديهم والإعتماد على توصيف برامج أكاديمية في اختصاص الصيدلة العام والتخصصي بما يحقق القدرات في المنافسة مستقبلاً مع نظيراتها.\\n\"}]}', '{\"ops\":[{\"insert\":\"إيجاد بيئة أكاديمية تساعد الطلبة على التطور الأكاديمي. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"إعداد الطلبة حتى يكونوا قادرين على أداء مهامهم الوظيفية كصيدلي بعد التخرج. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تزويد الطلبة بالمؤهلات والمهارات من خلال المحاضرات والمعامل وورش العمل لتخريج طلبة كفوءين ويكونوا ايضاً قادرين على متابعة دراستهم العليا في مجالات الصيدلة المختلفة. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"العمل كمركز لخدمة المجتمع من خلال مساعدة أفراده وتقديم المعلومات العلاجية المتخصصة للمرضى منهم وذلك عن طريق المشاركة في الأنشطة الثقافية المقامة وايضاً الندوات والمحاضرات الإرشادية في مجال الصيدلة. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"الريادة في مجال أبحاث تقنية النانو العلاجية من خلال إجراء أبحاث ودراسات في مجال العلوم الصيدلية.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"دعم نظام إدارة جودة التعليم الصيدلاني من خلال تطوير عملية التعليم والتدريب الصيدلاني بالتحسين والتحديث المستمرين للمناهج والبرامج التعليمية.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"Seeking to secure and achieve educational, educational and humanitarian programs in order to raise skills and build the capabilities of educational outputs in pharmaceutical education, training and scientific research to develop pharmaceutical services provided to the beneficiaries.\\n\"}]}', '{\"ops\":[{\"insert\":\"Preparing qualified clinical pharmacists who hold a specialized certificate in pharmacy sciences according to international standards to be able to apply clinical pharmacy practices and provide therapeutic services to patients by opening educational and educational windows with corresponding educational institutions in this field to benefit from their accumulated experiences and rely on the description of academic programs in the field of pharmacy General and specialized in order to achieve capabilities in future competition with its counterparts.\\n\"}]}', '{\"ops\":[{\"insert\":\"Creating an academic environment that helps students develop academically.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Preparing students to be able to perform their job duties as a pharmacist after graduation.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Providing students with qualifications and skills through lectures, laboratories and workshops to graduate qualified students who are also able to pursue their higher studies in various fields of pharmacy.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Working as a community service center by helping its members and providing specialized treatment information to patients by participating in cultural activities, as well as seminars and lectures in the field of pharmacy.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Pioneering in the field of therapeutic nanotechnology research by conducting research and studies in the field of pharmaceutical sciences.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Supporting the quality management system of pharmaceutical education through the development of the process of pharmaceutical education and training with the continuous improvement and updating of educational curricula and programs.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 18, '2021-08-30 13:35:18', '2021-09-13 09:06:47', 0);
INSERT INTO `abouts` (`id`, `ar_vision`, `ar_message`, `ar_goals`, `en_vision`, `en_message`, `en_goals`, `department_id`, `created_at`, `updated_at`, `is_deleted`) VALUES
(19, '{\"ops\":[{\"insert\":\"يقدم قسم تقنيات الحاسوب برامج دراسية وخدمات تعليمية عالية الجودة و يسعى من خلالها الى تأهيل الطلبة في تفرعات شبكات إتصالات الحاسوب بهدف توسيع فرص العمل المستقبلي للطلبة, وتجري التفرعات بالتنسيق مع الكليات الحكومية التي تمت التوأمه معها وبأشراف مباشر من وزارة التعليم العالي والبحث العلمي. كما يسعى القسم للتنسيق مع المؤسسات الحكومية والأهلية في التفاعل العلمي معها لتهيئة ارضية لفرص عمل مستقبلية للطلبة, حيث تمت تهيئة مشاريع التخرج بما يتناسب مع احتياجات مؤسسات الدولة المختلفة وذلك ليتم زج الطالب في سوق العمل ليتعايش بشكل مباشر مع الحياة العملية.\\n\"}]}', '{\"ops\":[{\"insert\":\"تخريج المهندس القادر على اجراء البحوث الاساسية والتطبيقية في العلوم الهندسية المرتبطة بالحاسبات بصورة تمكن من تطوير البحث العلمي وايجاد الحلول العلمية والعملية للمشاكل التي تواجهها اجهزة الدولة والمصانع المؤسسات والهيئات المختلفة.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"القابلية على تصميم بدائل الاجزاء العاطلة في الحاسبة.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"اجراء البحوث والدراسات على الحاسبات والبدائل الممكن استخدامها والتطوير المستمر في عمل وصيانة الحاسبة.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تفعيل آلية تطوير المشاريع الرقمية في برنامج المختبرات التعليمية.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تنشيط المشاريع العلمية ذات القدرة في بناء المعرفة الحديثة لمواكبة التطور التكنولوجي وفق الاختصاص الدقيق.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تطوير التصاميم الهندسية في المجال الالكتروني وأنظمة التحكم والمسيطرات الرقمية في مجال الشبكات والاتصالات وورش العمل.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"تحقيق متطلبات المنظمات الطبية والصناعية في رفع المشاريع الرقمية الالكترونية للكشف عن الحالات المطلوبة تشخيصها بدقة. \"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تأهيل الطلاب في المجال البرمجي ومجال الاتصالات وبرامج الشبكات العالمية.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"بناء المشاريع الالكترونية الخاصة بتطبيقات الحياة العلمية في ميادين الحياة المختلفة.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"تزويد الطلبة بأحدث المهارات في مجال تكنولوجيا شبكات واتصالات الحاسوب واستكمال التوجه العلمي لمواجهة تحديات صناعة الحوسبة الحديثة.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"دعم الخريجين في ايجاد فرص عمل في شركات القطاعين الخاص والحكومي من خلال التنسيق مع الشركات والدوائر الرسمية واقامة ورش العمل والندوات.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\".دعم التدريسيين والطلبة لتعميق ثقافة البحث العلمي لديهم لما له من اهمية في رصانة الكلية والقسم وتعزيز ذلك في المحافل العلمية المحلية والعالمية.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"The Department of Computer Technologies offers high-quality study programs and educational services and seeks through it to qualify students in the branches of computer communication networks in order to expand future employment opportunities for students. The department also seeks to coordinate with governmental and private institutions in scientific interaction with them to prepare the ground for future job opportunities for students, as graduation projects have been prepared in proportion to the needs of the various state institutions, in order to plunge the student into the labor market to coexist directly with working life.\\n\"}]}', '{\"ops\":[{\"insert\":\"Graduation of the engineer who is able to conduct basic and applied research in engineering sciences related to computers in a way that enables the development of scientific research and finding scientific and practical solutions to the problems faced by state agencies, factories, institutions and various bodies.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"The ability to design replacements for the faulty parts of the calculator.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Conducting research and studies on computers, alternatives that can be used, and continuous development in the work and maintenance of the computer.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Activating the mechanism for developing digital projects in the educational laboratories program.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Activating scientific projects with the ability to build modern knowledge to keep pace with technological development according to the exact specialization.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Developing engineering designs in the electronic field, control systems and digital controllers in the field of networks, communications and workshops.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"Achieving the requirements of medical and industrial organizations in raising electronic digital projects to detect cases that are required to be accurately diagnosed.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Qualifying students in the field of software, communications and global networking programs.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Building electronic projects for scientific life applications in various fields of life.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Providing students with the latest skills in the field of computer networks and communications technology and completing the scientific orientation to meet the challenges of the modern computing industry.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Supporting graduates in finding job opportunities in private and government sector companies through coordination with companies and official departments and holding workshops and seminars.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"},{\"insert\":\"Supporting faculty and students to deepen the culture of scientific research for them because of its importance in the sobriety of the faculty and the department and to promote this in local and international scientific forums.\"},{\"attributes\":{\"list\":\"ordered\"},\"insert\":\"\\n\"}]}', 26, '2021-08-30 13:51:51', '2021-09-13 09:06:47', 0),
(21, '{\"ops\":[{\"insert\":\"asdwefasd\\n\"}]}', '{\"ops\":[{\"insert\":\"sadq3werdas\\n\"}]}', '{\"ops\":[{\"insert\":\"dwqdqw\\n\"}]}', '{\"ops\":[{\"insert\":\"asfdwefa\\n\"}]}', '{\"ops\":[{\"insert\":\"qwdwq3edqwd\\n\"}]}', '{\"ops\":[{\"insert\":\"dqwdqwdq\\n\"}]}', 13, '2021-09-04 16:13:09', '2021-09-13 09:06:47', 0);
