(7, 'test', NULL, 'news/ipdW1Hcm1rpjJqbwkp1YkfWKnUP3waVDaenf3tMF.jpg', 0, 'testtestetstetstetstets', NULL, NULL, NULL, 1, '2021-07-30 06:06:35', '2021-09-13 09:06:47', 1),
(25, 'اتمام كلية النسور الجامعة توزيع نتائج امتحانات الدور الاول لجميع المراحل', 'Part of the completion of Al-Nisour University College, distributing the results of the first round exams for all stages', 'news/gmRNqNE3vx23UrrMmTBnPsT3JmhNN3j86Cs0roe0.png', 92, '{\"ops\":[{\"insert\":\"جانب من اتمام كلية النسور الجامعة توزيع نتائج امتحانات الدور الاول لجميع المراحل مما سيرفد بلدنا العزيز بنخبة من الكادر الطبي و المهندسين التقنين والقانونيين والإداريين والرياضيين والعلوم الاجتماعية. متمنين دوام النجاح والتألق لطلبتنا الاعزاء. \\n(الاعلام وتكنولوجيا المعلومات)\\n\"}]}', '{\"ops\":[{\"insert\":\"Part of the completion of Al-Nisour University College, distributing the results of the first round exams for all stages, which will provide our dear country with an elite group of medical staff, technical engineers, legal, administrative, athletes and social sciences. We wish continued success and brilliance to our dear students.\\n(media and information technology)\\n\"}]}', 'جانب من اتمام كلية النسور الجامعة توزيع نتائج امتحانات الدور الاول لجميع المراحل مما سيرفد بلدنا العزيز بنخبة من الكادر الطبي و المهندسين التقنين', 'Part of the completion of Al-Nisour University College, distributing the results of the first round exams for all stages, which will provide our dear country with an elite group of medical staff,', 12, '2021-08-25 10:38:50', '2021-10-04 08:39:51', 0),
(26, 'اجتماع حول التصنيف الوطني للجامعات العراقية', 'A meeting on the national classification of Iraqi universities', 'news/j4PIe3mZp1GbF2NYIWVdseZHGXqnRkc1SWkyD4m6.jpg', 54, '{\"ops\":[{\"insert\":\"تم بتاريخ 31/8/2021 ..عقد اجتماع برئاسة السيد عميد كلية النسور الجامعة  المحترم وبحضور كل من السادة رؤساء الاقسام وقسم ضمان الجودة وقسم تكنولوجيا المعلومات  والسادة مقررين الاقسام العلمية واعضاء ارتباط الجودة  وتم مناقش مجموعة من المواضيع على راساها موضوع التصنيف الوطني العراقي واستعدادات الكلية للشروع في تحقيق المتطلبات تم توضيح محاور استمارات التصنيف الوطني من قبل قسمي ضمان الجودة وتكنولوجيا المعلومات والاستماع الى اسئلة الحضور والاجابة عليها وتمخض الاجتماع عن مجموعة من التوصيات ونوجزها بما يلي:\\n • دعم كامل من الادارة العليا المتمثلة بالسيد العميد المحترم لمشروع التصنيف الوطني\\n • التأكيد على تلبية المتطلبات الواردة في التصنيف الوطني بالاطار الزمني المحدد\\n • التأكيد على تفعيل عمل بعض الوحدات التنظيمية في الكلية مثل وحدة متابعة الخريجين\\n • دراسة استحداث وحدة لتسويق النتاجات التعليمية\\n • اعادة النظر بالهيكل التنظيمي والعمل على تطويره عن طريق الاتفاق مع جهات رسمية رصينة لهذا الغرض وتم اختيار مفاتحة المركز الوطني للتطوير الاداري / وزارة التخطيط\\n( الاعلام و تكنولوجيا المعلومات ) \\n\"},{\"attributes\":{\"color\":\"var(--accent)\",\"link\":\"https://www.facebook.com/hashtag/%D9%83%D9%84%D9%8A%D8%A9_%D8%A7%D9%84%D9%86%D8%B3%D9%88%D8%B1_%D8%A7%D9%84%D8%AC%D8%A7%D9%85%D8%B9%D8%A9?__eep__=6&__cft__[0]=AZVZKuUhbCWuEaqEHAuEg3Md-KnRlWSDnZ8p1EmFUvdkEqbjt3mm8HcUePjp-8_eDpiDWCRvttMXCRO-A5fPa5U1IYtTIKwC0zafWZb8KQwOlplMr-t23C8JhyO88iqeS3YuT0fkfDMtuVgP4LzcmuaA&__tn__=*NK-R\"},\"insert\":\"#كلية_النسور_الجامعة\"},{\"insert\":\"\\n\"}]}', '{\"ops\":[{\"insert\":\"A meeting was held on 08/31/2021..a meeting chaired by the esteemed Dean of Al-Nisour College, the University, and in the presence of the heads of the departments the Quality Assurance Department, the Information Technology Department, the rapporteurs of the scientific departments and members of quality and quality, a discussion of topics on top of which is the Iraqi national classification and the college’s preparations, and to start realizing the dream Clarification of the axes of the national award form from before, the answer of happiness, agreement, agreement, award, communication, and the initiation of the meeting, as follows:\\n\\n • Full support from the senior management represented by the esteemed Dean of the National Classification Project\\n • Great Jamahiriya\\n • Good on activating some units in the college, such as following up on graduates\\n • Studying the creation of a unit for marketing educational products\\n • Reconsidering the organizational structure and working to develop the path of agreement with solid official bodies for this, and the approach to the National Center for Administrative Development / Ministry of Planning was chosen.\\n\\n(media and information technology)\\n\\n# Al-Nisour_University College\\n\"}]}', 'عقد اجتماع برئاسة السيد عميد كلية النسور الجامعة  المحترم وبحضور كل من السادة رؤساء الاقسام وقسم ضمان الجودة وقسم تكنولوجيا المعلومات', 'meeting chaired by the esteemed Dean of Al-Nisour College, the University, and in the presence of the heads of the departments', 12, '2021-09-02 09:35:13', '2021-10-04 05:31:12', 0),
(27, 'انطلاق امتحانات الدور الثاني  لطلبة كلية النسور الجامعة داخل اروقة الكلية و قاعاتها .', 'The launch of the second round exams for the students of Al-Nisour University College inside the corridors and halls of the college.', 'news/0ULxmaQTZUhuk2FbrkVkUl7MXs4xzAVIxUuvFcWI.jpg', 18, '{\"ops\":[{\"insert\":\"استقبال طلبة كلية النسور الجامعة المشمولين بامتحانات الدور الثاني حيث سيتم اداء الامتحانات الحضورية للمواد المقررة من وزارة التعليم العالي و البحث العلمي العراقية داخل اروقة الكلية \\n\\nاما الامتحانات الالكترونية فسيتم اداءها عن طريق الصفوف الالكترونية على منصة كوكل كلاسروم .\\nمتمنين النجاح و الموفقية للجميع .\\n( الاعلام و تكنولوجيا المعلومات )\\n\"}]}', '{\"ops\":[{\"insert\":\"Receiving the students of Al-Nisour University College who are covered by the second round exams, where the attendance exams for the subjects prescribed by the Iraqi Ministry of Higher Education and Scientific Research will be performed inside the corridors of the college\\n\\nAs for the electronic exams, they will be performed through electronic classes on the Google Classroom platform.\\nWishing success and success to all.\\n( Media & IT)\\n\"}]}', 'استقبال طلبة كلية النسور الجامعة المشمولين بامتحانات الدور الثاني حيث سيتم اداء الامتحانات الحضورية للمواد المقررة من وزارة التعليم العالي و البحث العلمي العراقية داخل اروقة الكلية', 'Receiving the students of Al-Nisour University College who are covered by the second round exams,', 12, '2021-09-11 08:00:41', '2021-09-22 14:59:18', 0);
