(80, 'م.م . منعم حسين علي', 'لديه خبرة في العمل على برامج الاوفيس . لديه خبرة في القاء المحاضرات الاليكترونية على منصة google classroom . لديه خبرة في اقامة الندوات العلمية . لديه خبرة في اعداد البحوث العلمية.  حاصل على العديد من الشهادات التقديرية الخاصة بالندوات والمؤتمرات. عضو اللجنة المركزية للتهيؤ للامتحانات النهائية. عضو في لجنة اعداد الخطة الاستراتيجية في الكلية . عضو لجنة امتحانية في القسم.', 'A.L. Monem  Hussain Ali', 'He has experience working with Office programs. He has experience delivering electronic lectures on the Google Classroom platform. He has experience in organizing scientific symposia. He has experience in preparing scientific research. He holds many certificates of appreciation for seminars and conferences. Member of the Central Committee to prepare for the final exams. Member of the strategic plan preparation committee at the college. Member of the Examination Committee in the department.', 'monem.h.bs@nuc.edu.iq', 'ماجستير', 'techerImage/TTJ3DIKhdaytx6nj3nhTfSS37zB0h25IMlBsZAqM.jpg', 'الاقتصاد', 'الاقتصاد - تمويل مصرفي', 'Master', 'Economy', 'Economy - Bank Finance', 'TeacherCv/1DpojiDM0h23RW1wsnd0yENSqHANsin6umyJyX9c.pdf', 'EnTeacherCv/9WFHHJN0iw5E6QKfDPaOdKjb13aPk3hWevHeHlTo.pdf', 13, 0, '2021-09-18 08:02:47', '2021-09-18 08:02:47', 0),
