(87, 'م. امال منصور حسن', 'الخبرة في التدريس للفترة من 2013 ولغاية 2021  من خلال استخدام كافة وسائل التعليم بالاضافة الى الخبرة البحثية ونشر العديد من البحوث بمجلات عالمية وعربية ومحلية . ايضا الاشتراك بالعديد من اللجان ( اللجان الامتحانية – لجان تدقيق السجلات الامتحانية – لجنة الارشاد التربوي – الاشراف التربوي – النشاطات اللاصفية  - الاشراف على بحوث تخرج الطلبة – مسؤولة التعليم المستمر وتدريب الطلبة  ) . بالاضافة الى امتلاكي مهارات في اغلب البرامج التي لها علاقة  بالتعليم الالكتروني واتقان العديد من البرامج التعليمية الحديثة  واتقان استخدام الحاسوب .   البرامج المتقن استخدامها :  .	Microsoft  office :        (Word- Excel – Access -  Power Point – one Drive – Teams  office 365 Educatio .Google Classroom . Google Meet .GIS  Geographic information system .MIS   Management Information Systems . Zoom .Free Conference Call . SPSS', 'Lect.Amal mansoor hasan', 'Teaching experience for the period from 2013 to 2021 through the use of all teaching aids in addition to research experience and the publication of many researches in international, Arab and local journals. Participation in many committees (examination committees - committees for checking examination records - educational guidance committee - educational supervision - extra-curricular activities - supervising students\' graduation research - responsible for continuing education and training students). In addition to having skills in most programs related to e-learning, mastering many modern educational programs and mastering the use of computers. Proficient Software to Use: 	Microsoft  office :        (Word- Excel – Access -  Power Point – one Drive – Teams  office 365 Educatio . Google Classroom . Google Meet . GIS  Geographic information system . MIS   Management Information Systems . Zoom . Free Conference Call . SPSS .', 'amaal.bs@nuc.edu.iq', 'ماجستير', 'techerImage/a26zASLxXkqeONcRgxYI79UnxiH7cIGgiC5JAbtQ.png', 'اقتصاد / تخطيط', 'تخطيط سياسات', 'Master', 'Economy / planning', 'Policy Planning', 'TeacherCv/gH0P