(105, 'م.م احمد مزاحم شلال', 'ماجستير في تخصص علوم الحياة. لقبي مدرس مساعد. تدريس مواد عملية مختبريه لمادة الاحياء البشري للمرحلة الاولى والفسلجة للمرحلة الثانية لقيم تقنيات المختبرات الطبية/ كلية النسور الجامعة. وتدريس مادة النظري ادارة المختبرات الطبية للمرحلة الرابعة. اعطاء المجال العملي في المختبرات الخاصة للمواد العملية المذكورة اعلاه ضمن فترة العام الدراسي حضوريا واسنادها الكترونيا على منصة كوكل كلاس روم مع تعليم الطلاب استخدام الادوات المختبرية ضمن منهج الدراسي العملي للمادة', 'assistant teacher  Ahmed Muzahem Shallal', 'Master\'s degree in life sciences.  My title is an assistant teacher.  Teaching laboratory practical materials for Human Biology for the first stage and Physiology for the second stage for the values ​​of Medical Laboratory Techniques / Al-Nisour University College.  Teaching the theory of Medical Laboratory Management for the fourth stage.  Giving the practical field in private laboratories to the above-mentioned practical materials within the academic year period in attendance and assigning them electronically on the Google Classroom platform, while teaching students to use laboratory tools within the practical curriculum of the subject.', 'Ahmed.m.path@nuc.edu.iq', 'ماجستير', 'techerImage/kGQqEAqvmEWiu6m2xS9SS96jbi2b6OwBK0kzjZo8.jpg', 'علوم حياة', 'علوم حياة /ضمن المعادلة', 'Master', 'Biology', 'Biology', 'TeacherCv/zygQI03YTF6bT5yXrnSowqryrdqsMuF0wdds2Lj6.jpg', 'EnTeacherCv/4rA46Wic4EErLKKuKM4BcQUj4xSu7BLTIZHRK5CW.jpg', 17, 0, '2021-09-19 08:13:11', '2021-09-19 08:13:11', 0),
