(117, 'م .د. محمد عبد جواد العامري', 'تدريسي في كليه النسور الجامعة من سنة 2013 مقررقسم تقنيات المختبرات الطبية ولغاية اليوم ، مقرر مجلس كلية النسور الجامعه   لمده سنتين ٢٠١٥-٢٠١٨  امين مجلس الكلية النسور الجامعه من سنة ٢٠١٩ الى غاية اليوم و مدير مركز التعليم المستمر.  اكملت دراسه البكالوريوس سنة في اختصاص تقنيات التحليلات المرضيه ٢٠١٣-٢٠١٤  اكملت دراسة الماجستر من الجامعة التقنية الوسطى العراق  من كلية التقنيات  الصحية و الطبية / بغداد   في اختصاص تقنيات المختبرات الطبيه اختصاص ( مناعة سريرية )  ٢٠١٧  و اكملت ودراسة الدكتوراة في الجامعة التقنية الوسطى كلية التقنيات الصحة و الطبية / بغداد قسم تقنيات المختبرات الطبية  اختصاص العام تقنيات المختبرات الطبية  (المناعة السريريه و الجزيئية ) في سنة  ٢٠٢١', 'Lec.DR. Mohammed Abed Jawad kadhum', 'Manger of Counting education center   Vice dean for management affairs  Secretary of College Council .  Head assistant of Medical Laboratory technology  At  Al-Nisour University College Iraq - Baghdad .  Member of College Council .   Lecturer at Al-Nisour University College from 2013 in the Department of Medical Laboratory Technologies until know .  Secretary of the University College Council from 2019 until know   1- I complete my Bachelor\'s degree in the field of Medical Laboratory technology ( 2013-2014) 2- completed my  master\'s degree from the Middle  Technical University, Iraq, from the College of Health and Medical Technologies / Baghdad In the specialty of medical laboratory techniques (Clinical Immunology)  (2017 ) 3- completed doctorate PHD studies at the Middle Technical University, College of Health and Medical Technologies, Baghdad / Department of Medical Laboratory Technologies General Specialization Medical Laboratory Technologies  (Clinical and Molecular Immunology) in (2021)', 'mohammed.a.medical.lab@nuc.edu.iq', 'دكتوراه', 'techerImage/rFZZm0oszdrm0gLse17buPCWaaXTKDfwgWagrUUQ.jpg', 'تقنيات المختبرات الطبية', 'علم المناعة السريريه و الجزيئية', 'Master', 'Medical Laboratory Technology', 'Medical Laboratory Technolo